public Iterator<T> iterator() {
  final Iterator<T> it = Iterables.concat(chunks).iterator();

  return new Iterator<T>() {
    @Override
    public boolean hasNext() {
      return it.hasNext();
    }

    @Override
    public T next() {
      return it.next();
    }

    @Override
    public void remove() {
      it.remove();
      size--;
    }
  };
}

